  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The annual CMS Statistics reference booklet
  provides a quick reference for summary information about health expenditures and
  the Medicare and Medicaid health insurance programs. The CMS Statistics reference
  booklet is published in June of each calendar year and represents the most currently
  available information at the time of publication. CMS Statistics reference booklets
  are available for 2003 through the most currently available complete calendar year.</p>n\",\n\t\"license_title\":
